import React, { Component } from "react";

class RecipeFilters extends Component {
  render() {
    return (
      <div
        className="bgLightGray col-auto btn-group-vertical"
        role="group"
        aria-label="Recipe filters"
      >
        Hello Im a filter
      </div>
    );
  }
}

export default RecipeFilters;
